var b="url",c="xmgl_03_01_01立项项目-点击新增.html",d="generationDate",e=new Date(1643071765425.41),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="juese",s="show",t="DarkWindow",u="yewu_No",v="Data_No",w="Message_loading",x="Name_hetong",y="AxPlusSN",z="shaixuan",A="yang",B="page",C="packageId",D="4f4048e171e141b59bb1514bf0cfb891",E="type",F="Axure:Page",G="XMGL_03_01_01立项项目-点击新增",H="notes",I="annotations",J="fn",K="1",L="ownerId",M="530954120d6e415f8ed7b6cd720c328f",N="label",O="(文本框)",P="说明",Q="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">三级选择框</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">选择后显示全层级信息，例A-B-C</span></p>",R="2",S="ec5a4fea3c6f4f0e8045127c38c7e9e7",T="3",U="c602e589a1354849a6b0794735ee5341",V="下一步",W="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">按钮放在弹窗底部固定，根据页面发生变化</span></p>",X="4",Y="b90146eb402b4998b8a00b0612a01fd2",Z="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">纯输入内容，默认为当前登录用户</span></p>",ba="5",bb="fe660042ecd34f3abefdf4521ee9477e",bc="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">负责人类型为教师时，默认为校内项目负责人，跟随校内项目负责人变化。不可更改（不论角色类新型是个人、院级还是校级，都不能更改）</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">负责人类型为校外或者学生时，项目负责人可以更改，不必从人员库中选择</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p>",bd="6",be="606f3f6e3cfc4f1aac25939588a03300",bf="(下拉列表)",bg="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">选择项目分类后自动关联选择（参考“项目分类设置”模块）</span></p>",bh="7",bi="5d960594cc5f4d76a33f0dc2d1ee9279",bj="项目状态*",bk="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">默认项目状态是：进行中</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">真实项目状态记录，不以程序流程对项目状态进行控制。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">比如说，立项项目登记时，项目状态选择已结项，该项目就无变更、中检、结项、经费认领等业务。</span></p>",bl="8",bm="4f86d6d07f6942e2b9cae8e9576afcf4",bn="教育部统计归属*",bo="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">项目分类选定后自动带出，禁止修改。（参考“项目分类设置”模块）</span></p>",bp="9",bq="1c6015c193044ea398551ca285100865",br="负责人类型*",bs="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">负责人类型默认为教师，项目负责人只能在人员库中选择</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">负责人类型为学生或者校外，可以填写人员库之外的人员，备注人员类新型，如，张三（学生）</span></p>",bt="10",bu="a1f6d2adc93d46bc96748b039adf7399",bv="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">默认为当前登录用户</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">对人员类型为1（个人）登陆用户禁用，、</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">对人员类型不为1（院级或者校级）的用户启动，可更改</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p>",bw="11",bx="a4d790fd8a7c4608a447ae18d41784a2",by="校内项目负责人*",bz="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">即我们认知上的leader，（项目负责人）</span></p>",bA="12",bB="cac56b6d30314d5d94a88610f8717bbd",bC="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">多级选择器</span></p>",bD="13",bE="7d2a88c4aa6b4ad39d0e63a8febaa88f",bF="所属单位*",bG="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">禁止更改，默认为校内项目负责人【所在院系】</span></p>",bH="14",bI="439c50e2e6f64abd9693bed1953f6872",bJ="项目归属单位*",bK="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">3个变量选项</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">校内项目负责人</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">可选择：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">1.</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">所在单位（人事单位）</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">2.</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">所在院系（科研单位）</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">3.</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">所在科研机构</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">默认选择所在院系（即，科研单位）</span></p>",bL="15",bM="633b1fedda0d4cd6889668b743a8cdb7",bN="16",bO="9f92cae4626240c1b8d1c409150c1968",bP="17",bQ="e12462fbf6bb4269bcb661519483c76b",bR="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">自动创建项目负责人为项目成员，且署名顺序为第一位，不可调整顺序和删除该成员</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">允许项目成员不在成员库中选择，当未选择成员库成员，成员类型自动设置为校外，可更改成员类型（但只能在学生和校外进行选择）</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">如果成员时在成员库中选择的，成员类型自动设置为教师，获取成员属性，自动带出工作单位（所在单位）、职称、学位等信息，且不可更改</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">如果成员不是从成员库中选择，其余信息都可进行录入和选择</span></p>",bS="18",bT="4f60a62799244f8aa67290cce9d6f345",bU="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">不可更改</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">如果不是参与其他高校项目，校内实际负责人和负责人是同一人，这里是负责人</span></p>",bV="19",bW="28609c1edeac4c3ab9040d9586e2ad90",bX="项目成员",bY="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">除姓名外，其他信息不进行必填验证</span></p>",bZ="20",ca="e3f72a68b315400091b512ca1b0799aa",cb="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">项目负责人外，其他默认参与人，可更改（不可选择负责人）</span></p>",cc="21",cd="31b4618c06a040b0bb12ea415b8f40be",ce="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">成员类型默认为教师，人员只能从系统人员库中选择，如系统人员库中无输入人员，无法录入，工作单位、职称、学位自动带出</span></p>",cf="22",cg="7976bbb51b7a49feb9cc19a2a2c863a6",ch="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">不可更改</span></p>",ci="23",cj="fead5fd8e9934334bc08c041201ced45",ck="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">当本校老师做为项目参与人员</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">参与其他高校项目，录入项目信息时，自动创建2个成员信息</span></p>",cl="24",cm="74bba00fd60a4136a85d5305d8993f49",cn="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">不能选择教师</span></p>",co="25",cp="c50048e704174619aa1a9f17ad42a3ef",cq="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">其他成员，默认是参与人</span></p>",cr="26",cs="274576c8d8f942ac93b4109390d31384",ct="27",cu="c1a1c2f5d5014b45922ef60870f4f5df",cv="28",cw="8251db1d1f9744648a2dff89c228ad3f",cx="29",cy="5b1cb4ee716b449ea26931444a7988f1",cz="style",cA="baseStyle",cB="627587b6038d43cca051c114ac41ad32",cC="pageAlignment",cD="near",cE="fill",cF="fillType",cG="solid",cH="color",cI=0xFFFFFFFF,cJ="image",cK="imageAlignment",cL="imageRepeat",cM="auto",cN="favicon",cO="sketchFactor",cP="0",cQ="colorStyle",cR="appliedColor",cS="fontName",cT="Applied Font",cU="borderWidth",cV="borderVisibility",cW="borderFill",cX=0xFF797979,cY="cornerRadius",cZ="cornerVisibility",da="outerShadow",db="on",dc=false,dd="offsetX",de=5,df="offsetY",dg="blurRadius",dh="spread",di="r",dj=0,dk="g",dl="b",dm="a",dn=0